这是一个简单的Python计算器实现，可以进行基本的加减乘除操作：

```python
def calculator():
    while True:
        operation = input("请输入你要进行的操作（+、-、*、/），或输入'quit'退出：")
        if operation.lower() == 'quit':
            break
        num1 = float(input("请输入第一个数字："))
        num2 = float(input("请输入第二个数字："))
        if operation == '+':
            result = num1 + num2
        elif operation == '-':
            result = num1 - num2
        elif operation == '*':
            result = num1 * num2
        elif operation == '/':
            if num2 != 0:  # 防止除以零的错误
                result = num1 / num2
            else:
                print("错误：除数不能为零")
                continue
        else:
            print("错误：无效的操作符")
            continue
        print(f"{num1} {operation} {num2} = {result}")

calculator()
```

这个程序会持续运行，直到用户输入'quit'为止。注意，它处理了除以零的错误，如果用户尝试这样做，它会打印一个错误消息并继续下一个操作。

