Here's a Python program to find the first non-repeating character in a string:

```python
def first_non_repeating_char(s):
    char_count = {}
    for i, char in enumerate(s):
        if char not in char_count:
            char_count[char] = 1
        else:
            char_count[char] += 1

    for i, char in enumerate(s):
        if char_count[char] == 1:
            return i

# Test the function with the given string
string = "hello world"
print(first_non_repeating_char(string))  # Output: 2
```

In this program, we iterate over the string and count the occurrences of each character using a dictionary. Then, we traverse the string again, checking if the count of each character is 1. When we find one, we return its index. The first non-repeating character in "hello world" is 'l', at index 2.

